DescriptionModule.DetailedDescription:
Around 1420 children born between 2006 and 2010 had been eligible to routine immunization program with pneumococcal vaccines.

The objective of this study is to document the residual burden of acute upper respiratory infections (AURIs), acute lower respiratory infections (ALRIs), otitis media (OMs) and auditory functional and anatomical abnormalities in children under the age of 5 years in Nunavik who will be exposed to PHiD-CV in combination with PCV-7 or PCV-13. The comparison groups will be the cohorts of children who received no PCV vaccine (those born in 1994-1996) and those exposed to PCV-7 exclusively (those born in 2003-2007).

The specific objectives are to measure in children under the age of 5 years in Nunavik and born in the period 2009 to 2010:

the incidence of invasive pneumococcal disease(IPD), AURIs, ALRIs and OMs;
the frequency of antibiotic treatments due to these diseases;
the frequency of hospitalizations and transfers to the South on account of ALRIs;
the frequency of tympanotomies and ventilation tube insertions;
the prevalence of anatomical and functional lesions of the middle ear at the age of 5 years (the main issue).

The main research hypothesis is that the incidence of AURIs, ALRIs and OMs and the prevalence of sequelae from OM decreased after the implementation of PHiD-CV in 2009, as compared with previous cohorts of children who were not exposed to this new vaccine.

EligibilityModule.EligibilityCriteria:
Inclusion criteria for the phase I portion of the study:

Healthy adults from 18 to <55 and 65-<85 years of age at the time of enrollment;
Able to provide consent to participate in and having signed an Informed Consent Form (ICF);
Able and willing to complete all the scheduled study procedures during the whole study follow-up period (about 6-8 months, depending on group);
Negative result of HIV, hepatitis B and C screening;
Oral temperature < 38.0℃;
Negative IgG and IgM antibodies against COVID-19;
Negative result of real-time quantitative PCR screening of nasopharyngeal swabs/sputum for SARS-CoV-2;
A body mass index (BMI) between 18-35;
Hematological examination is within normal range, or no greater than a grade 1 abnormality and no clinical significance as assessed by the study investigator (including white blood cell count, lymphocyte count, neutrophil count, eosinophil count, platelet, hemoglobin, alanine aminotransferase ALT, aspartate aminotransferase AST, total bilirubin, blood glucose and creatinine);
Transient mild laboratory abnormalities may be rescreened once and the participant will be deemed eligible if the laboratory repeat test is normal as per local laboratory normal values and investigator assessment.
Good general health status, as determined by history and physical examination no greater than 14 days prior to administration of the test article.
If female of child-bearing potential and heterosexually active, has practiced adequate contraception for 30 days prior to injection, has a negative pregnancy test on the day of injection, and has agreed to continue adequate contraception until 180 days after injection. (Please refer to the glossary for the definition of child-bearing potential and adequate contraception).

Inclusion criteria for the phase II portion of the study will be detailed in an amended synopsis/study protocol.

Exclusion criteria for the phase I portion of the study:

Personal history of seizure disorder, encephalopathy or psychosis;
Allergic history to any vaccine, or allergic to any ingredient of the Ad5-nCoV;
Woman is pregnant or lactating, positive urine pregnancy test or plan to become pregnant during the next 6 months;
Any acute febrile disease (oral temperature ≥38.0℃ or active infectious disease on the day of vaccination;
Medical history of SARS (SARS-CoV-1);
Serious cardiovascular diseases, such as arrhythmia, conduction block, myocardial infarction, severe hypertension not controlled with medication;
Serious chronic disease such as asthma, diabetes and thyroid disease, etc.;
Congenital or acquired angioedema;
Immunodeficiency, asplenia or functional asplenia;
Platelet disorder or other bleeding disorder that may cause intramuscular injection contraindication;
Immunosuppressive medication, anti-allergic, cytotoxic therapy, inhaled corticosteroids (excluding corticosteroid spray for allergic rhinitis, surface corticosteroid therapy for acute non-complicated dermatitis) in the last 6 months;
Prior administration of blood products in last 4 months;
Other vaccination(s) or investigational drugs within 1 month before study onset, or planned use during the study period;
Prior administration of live attenuated vaccine within 1 month before study onset;
Prior administration of subunit or inactivated vaccine within 14 days before study onset;
Current anti-tuberculosis therapy;
Any condition that in the opinion of the investigators may interfere with the participants' compliance or evaluation of study objectives or informed consent (i.e. medical, psychological, social or other conditions, etc.) Exclusion criteria for the phase II portion of the study will be detailed in an amended synopsis/study protocol.

Inclusion Criteria:

Male patients with an initial presentation of organ confined prostate cancer;(clinical stages T1c and T2a only)
Age 40 yrs. and older up to and including age 80 yrs.;
Anesthesia SUrgical Assignment (ASA) categories I, II or III only;
PSA levels equal tyo or less than 10ng/ml;
Pre-HIFU Gleason score equal to or less than 7;
Clearly imageable prostate on TRUS;
Prostate total volume less than 40cc with an AP height less than or equal to 4.2cm. (If volume is greater than 40cc or height greater than 4.2 cm, one 3 monthly shot of an LHRH analogue may be provided, followed by re-imaging of the prostate to document total volume below 40cc).

Exclusion Criteria:

Large calcification in the area to be treated (>5mm);
Bleeding disorder as determined by abnormal prothrombin time (INR) and partial thromboplastin time (PTT);
Pt. on Coumadin or any other anticoagulent, unless their anticoagulation an be temporarily reversed or stopped;
Urinary Tract infection unless treated satisfactorily by antibiotics and documented by a sterile urine culture;
Interest in future fertility;
History of allergy to latex;
Inability to visualize the prostate tissue adequately on transrectal ultrasound imaging;
History of treatment for prostate cancer (except for one LHRH analogue "shrinkage shot");
History of TURP, thermotherapy or urethral stent;
History of any major rectal surgery;
History of inflammatory bowel disease;
History of urinary bladder neck contracture;
History of any other malignancy other than skin cancer. Patients that have had a previous malignancy and no recurrence of that malignancy within the past 5 years will be allowed; (superficial bladder cancer is OK of clear for 2 years)
Inability to be placed in lithotomy position;
Prior long term hormonal therapy for prostate cancer (including bilateral orchiectomy).

Inclusion Criteria:

Non pregnant
between 18 and 55 years;
Body weight with a BMI range of 18.5 to 27.0 [or weight within 15% of ideal weight for subject's height and frame (to be based on Metropolitan Life Insurance Company weight tables);
Healthy, with normal findings in the physical examination and vital signs (BP between 100-140/60-90 mmHg, HR between 60 to 90 beats/min, respiration between 12 to 24 breaths/min, SpO2 >90% breathing room air) and no clinically-significant findings in a 12-lead electrocardiogram;
No clinical laboratory values outside of the laboratory normal reference range, unless the investigator determines them to be not clinically significant;
Non-smoking (i.e. having no history of tobacco, or other substance, smoking for greater than or equal to 12 months, and not having smoked within the past year by self-report);
Negative tests for smoking tobacco (urine cotinine test), alcohol (urine test), hepatitis B- surface antigen, hepatitis C antibody, tuberculin skin-prick test at screening;
Negative urine screen for drugs of abuse;
Willing and able to communicate well with the investigator and clinic staff, comply with the study procedure and schedule, and provide written informed consent;
Able to understand the requirements of the study and sign informed consent;

Exclusion Criteria:

Current major Axis I psychiatric disorder for which the subject is currently receiving treatment or which would make study compliance an issue;
Pregnant. A test will be available for prospective participants;
Breast-feeding women;
Any condition or therapy which, in the opinion of the investigator, may be significantly worsened by the administration of naltrexone or is likely to interfere with the successful collection of the measures required;
Acute disease at the time of enrolment (i.e. presence of a moderate or severe illness or infection with or without a fever);
Febrile illness (oral temperature >37.6º C at the time of drug administration);
Unstable chronic illnesses;
Chronic liver, renal or inflammatory bowel disease or collagen vascular disease;
Clinically significant elevation of ALT and/or AST;
Active neurological disorder;
Clinically significant uncontrolled illness or clinically significant surgery within 4 weeks prior to administration of study drug;
Cancer within the previous 5 years, other than squamous cell or basal cell carcinoma of the skin;
History of any clinical laboratory abnormality deemed significant by the Principal Investigator;
History of serious adverse reaction or hypersensitivity to any drug;
Bleeding tendency resulting from disease or medication rendering blood collection or the injection itself unsafe (use of antiplatelet agents is allowed);
Coagulation disorders or receiving anticoagulant therapy;
Inability to tolerate abstinence from caffeine for 24 hours prior to and during the study treatment phase;
Consumption of alcohol within 24 hours prior to dosing and during the treatment phase;
History of significant alcohol or drug abuse within one year prior to the screening visit or regular use of alcohol within six months prior to the screening visit (more than 14 units of alcohol per week [1 Unit = 150 mL of wine, 360 mL of beer, or 45 mL of 40% alcohol]);
Use of soft drugs (such as marijuana) within three months prior to the screening visit or hard drugs (such as cocaine, phencyclidine or crack) within one year prior to the screening visit or positive urine drug screen at screening or positive urine drug screen at screening;

Donation of plasma (500 mL) within 7 days prior to drug administration. Donation or loss of whole blood (excluding the volume of blood that will be drawn during the screening procedures of this study) prior to administration of the study medication as follows:

50 mL to 300 mL of whole blood within 30 days;
301 mL to 500 mL of whole blood within 45 days; or
more than 500 mL of whole blood within 56 days prior to drug administration.
Any known or suspected allergy to any constituent of naltrexone;
Any food allergy, intolerance, restriction or special diet that, in the opinion of the Principal Investigator or Sub-Investigators, contraindicates the subject's participation inthis study;
Use of any investigational or non-registered drug or participation in an investigational study within 30 days prior to administration of study drug.

SecondaryOutcome.SecondaryOutcomeDescription:
To determine the patients' comfort level during the colonoscopy, a five-item question used by the Joint Advisory Group on Gastrointestinal Endoscopy in the United Kingdom will be used.

Patient discomfort on the 5 point scale:

0 is no discomfort;

is one or two episodes of discomfort, well tolerated;
is more than two episodes of discomfort adequately tolerated;
is significant discomfort experienced several times during the procedure;
is extreme discomfort experienced frequency throughout the procedure.

Minimum value = 0, maximum value = 4 with 4 being worse.

